# Criamos agora o arquivo cal_n.py com o código:
def sum_n(n):
	return n * (n + 1) // 2

def sum_n2(n):
	t = 0
	for i in range(1, n + 1):
		t = t + 1
	return t
# Use para tanto o bloco de notas ou o notepad++
# Colocamos o arquivo fund_cal.py em arquivos para utiliza-lo

import cal_n
def main():
  n = int(input ("Digite um número desejado para o cálculo :"))
  sum_v = cal_n.sum_n(n)
  print("A soma da soma de 1 até", n, "é: ",sum_v)
  sum_vv = cal_n.sum_n2(n)
  print("A soma de adicionar consecutivamente de 1 até", n, "é: ",sum_vv)
main()

