"""## **Unidade 36: Pandas DataFrame para processamento de dados**

**DataFrame**
- É uma estrutura de dados de etiqueta bidimensional composta de linhas e colunas.
- Pode ter vários valores por etiqueta de índice.

![image.png](data:image/png;base64,)

- Os termos comumente usados em estatísticas de dados e campos de ciência de dados estão resumidos abaixo.

![image.png](data:image/png;base64,)

**Criação de DataFrame**
- Múltiplas séries podem ser combinadas para criar um DataFrame.

![image.png](data:image/png;base64,)
"""

# Criação de um DataFrame
import pandas as pd
data ={'col_1':[3,2,1,0],'col_2':['a','b','c','d']} # converter um dicionário chamado data em DataFrame
pd.DataFrame(data)

# Noções básicas de criação de DataFrame
import pandas as pd
s1= pd.Series([1.0,2.0,3.0],index= ['a','b','c']) # armazenar o objeto Series (série) em s
s2= pd.Series([1.0,2.0,3.0,4.0],index= ['a','b','c','d']) # armazenar outro objeto Series, em s2
print(s1, '\n')
print(s2, '\n')

data = {'one': s1,'two': s2} # criar um dicionário com as duas séries com 'one' e 'two' como chave
print(data,'\n')

pd.DataFrame(data) # quando o DataFrame é criado, os nomes das chaves do dicionário utilizado como argumento tornam-se os nomes das colunas
# NaN ocorre na última entrada porque o número de elementos nas duas séries são diferentes

"""**Definir os nomes de linha (index) / coluna (column) do DataFrame**
- Pode definir os nomes das linhas e colunas separadamente ao criar um DataFrame ou depois de criá-lo.

![image.png](data:image/png;base64,)
"""

# Criar nome para a linha e coluna inteira

import pandas as pd
d ={'col1':[1,2],'col2':[3,4]} # d é do tipo de dados dicionário
df = pd.DataFrame(data = d) # crie um objeto DataFrame de nome df, atribuindo o dicionário d
print(df, '\n') # verifique o DataFrame criado antes das mudanças

# mudança para novo nome de índices (linhas): objeto_DataFrame.index = conjunto de índices de linha a alterar
df.index = ['new index0', 'new index1']
print(df, '\n')

# mudança para novo nome de colunas: objeto_DataFrame.columns = conjunto de novos nomes de colunas
df.columns = ['new_col1','new_col2']
print(df)

# Criar nome para linha e coluna específica
# Selecione parte das linhas e as renomeie: objeto_DataFrame.rename(index={indice_existente: indice_para_substituicao)

import pandas as pd
d = {'col1':[1,2],'col2':[3,4]}
df = pd.DataFrame(data = d)
print(df, '\n')

# alterar índice 0 para um novo nome, 'new index0'
print(df.rename(index={0:'new index0'}), '\n')

# mude o nome da coluna col2 para o novo nome 'new col2'
print(df.rename(columns={'col2':'new col2'}))

# Usar inplace = True para alterar o objeto original
import pandas as pd
d ={'col1':[1,2],'col2':[3,4]}
df = pd.DataFrame(data =d)
df.rename(index={0:"new index0"},inplace = True)
df.rename(columns={"col2":'new col2'})

"""**Converter um dicionário em um DataFrame é usar .from_dict()**"""

import pandas as pd
s1= pd.Series([1.0,2.0,3.0],index= ['a','b','c'])
s2= pd.Series([1.0,2.0,3.0,4.0],index= ['a','b','c','d'])
dic_data = {'one':s1,'two':s2}
type(dic_data)

pd.DataFrame(dic_data)

pd.DataFrame.from_dict(dic_data,orient='columns')

pd.DataFrame.from_dict(dic_data,orient='index')

data={'row_1':[3,2,1,0],'row_2':['a','b','c','d']}
pd.DataFrame.from_dict(data,orient='index',columns=['A','B','C','D'])

"""**Conversão de vários objetos de dados em DataFrame**
- Dados são inseridos e convertidos usando várias ferramentas de I/O (texto, CSV, HDF5, ...) do pandas.

![image.png](data:image/png;base64,)

**Sobre os caminhos de arquivos**
- **Caminho absoluto**
  - Todo o caminho desde o primeiro ponto de partida (ponto inicial definido pelo sistema operacional) até o arquivo.
- **Caminho relativo**
  - É a "localização do arquivo que você quer encontrar" com base na "localização atual"

**Método dataframe.head() para revisão de dados**
- Esse método retorna as linhas dos primeiros n itens do DataFrame.
- Verificar o resultado do DataFrame que está sendo processado atualmente enquanto os dados estão sendo processados
"""

import pandas as pd

df = pd.DataFrame({'animal':['alligator','bee','falcon','lion','monkey','parrot','shark','whale','zebra']})
print(df)
print(df.head()) # se nenhum argumento for usado em head, apenas 5 itens são retornados
print(df.head(3)) # retornar os dados do topo até o índice n informado em head
print(df.head(-3)) # se "-" for introduzido, os dados são devolvidos após excluir 3 linhas do final

print(df.shape) # verificar em quantas dimensões consiste esse DataFrame
print(len(df)) # comprimento de uma linha
print(df.columns) # imprimir as colunas
print(df.values) # mostrar os valores de um DataFrame

