# Sintaxe: DataFrame.dropna(axis=0, how='any', thresh=None, subset=None, inplace=False)
import pandas as pd
import matplotlib.pyplot as plt
import seaborn as sns
df = sns.load_dataset('titanic', cache = True)

# Eliminar Coluna

new_df = df.dropna(axis = 1, thresh = 500) # elimina colunas com mais de 500 dados ausentes
