# Eliminar Linha

# subset=['age'], exclua todas as linhas com valores NaN (eixo=0) das linhas na coluna age.
# how ='all' é excluído somente se todos os dados forem NaN
age_df = df.dropna(axis = 0, how = 'any', subset = ['age'])
len(age_df)

# Eliminar todas as colunas com NaN

