"""**Substituição de dados ausentes por outros dados**"""

# Sintaxe: DataFrame.fillna(value=None, method=None, axis=None, inplace=False, limit=None, downcast=None)

"""- Substituindo com a média"""

import pandas as pd
import seaborn as sns
df = sns.load_dataset('titanic', cache = True)

print(df['age'].head(10), '\n\n') # verifique os dados na coluna de idade (age), alguns dados são NaN

avg_age = df['age'].mean(axis=0) # é a média dos dados na coluna de idade que esta armazenada em avg_age
print(avg_age, '\n\n')

median_age = df['age'].median(axis=0) # é a mediana dos dados na coluna de idade que esta armazenada em median_age
print(median_age, '\n\n')

# Os elementos de dados NaN são substituídos com a média usando fillna(), usando o valor mediano da avg_age calculado anteriormente
print(df['age'].fillna(avg_age, inplace = True))

# Podemos ver que os dados em falta são substituídos pela média
print(df['age'].head(10))

# Não há mais nenhum NaN  na coluna de idade (age).
print(df.isnull().sum())

"""- Substituindo com o valor máximo"""

# Procurar os dados que faltam no Embark_town, procurando o nome da cidade com mais passageiros e substituí-los pelos dados

import pandas as pd
import seaborn as sns
df = sns.load_dataset('titanic', cache = True)

print(df['age'].head(10), '\n\n') # verifique os dados na coluna de idade (age), alguns dados são NaN

# devolver a série cronológica incluindo linhas únicas na coluna correspondente - excluir os dados ausentes.
town_count = df['embark_town'].value_counts(dropna = True)
print(town_count, '\n\n')

# df.idxmax() retorna o índice do valor com mais ocorrências no eixo solicitado
most = town_count.idxmax()
print(most)

# método fillna(), os elementos de dados NaN são substituídos pelo nome da cidade de embarque mais frequente, armazenada na variável most
df['embark_town'].fillna(most, inplace = True)

# dados em falta na coluna embark_town foram substituídos por Southampton, resultando em nenhum dado em falta na coluna.
df.isnull().sum()

"""- Substituição por valores do vizinho mais próximo"""

df_01 = df['embark_town'].fillna(method = 'ffill', inplace = True)
df_02 = df['embark_town'].fillna(method = 'bfill', inplace = True)

# Imprima df_01 e df_02 e compare os dois quadros de dados para ver como o local onde os dados em falta foram preenchidos!
print(df_01, '\n')
print(df_02)

"""## **Unidade 38: Dados de séries temporais**

**Dados de séries cronológicas**
- São um conjunto de valores organizados no tempo, coletados durante um determinado tempo ou período.
- Dois tipos de dados da série temporal em Pandas:
  - Carimbo da hora: um ponto no tempo
  - Período: dois pontos de tempo, ou seja, um período constante entre dois carimbos de tempo

- Vários timestamps são reunidos para criar uma matriz e se tornarem um Datetimeindex.

![image.png](data:image/png;base64,)

- Elementos dos dados da série cronológica

![image.png](data:image/png;base64,)


![image.png](data:image/png;base64,)

- **Modelo aditivo de séries cronológicas**: análise de dados de séries cronológicas
- Fator de tendência + Fator de ciclo + Fator sazonal + Fator irregular/ aleatório

**Criação de um intervalo de data, hora e frequência**
- O objeto datetime faz parte da biblioteca datetime da Python.
- Classe usada para expressar padrões gerais e diversos, tais como um ponto específico no tempo usando tanto a data quanto a hora.

- Criar data e hora com classe **Datetime** python
"""

import pandas as pd
import numpy as np
import datetime

from datetime import date, datetime, time, timezone

print(datetime(2021,7,7), '\n') # pelo menos 3 parâmetros correspondentes ao ano, mês e dia - hora e minuto são retornados como 0 por padrão

print(datetime(2021,7,7,15,50)) # hora e minuto definidos

# Método combine(): pode criar um objeto datetime usando um objeto data ou hora existente.
d = date(2021,7,7)
t = time(13,26,10)
print(datetime.combine(d, t))

# Data e hora atual, hora local
print(datetime.now())

# Se um fuso horário é usado como parâmetro no método agora, um objeto de datetime aplicado com o fuso horário é criado.
print(datetime.now(timezone.utc))

# Obtenha a hora e atuais e devolva somente a data
print(datetime.now().date(), '\n')

# Obtenha a hora e data atuais e devolva somente a hora
print(datetime.now().time())

"""- Criar um ponto no tempo com **Pandas Timestamp**"""

# Tanto a data quanto a hora podem ser definidas na criação
print(pd.Timestamp('2017, 1, 15'))

# Criado especificando a hora
print(pd.Timestamp('2017, 5, 3, 12:00'))

# Se apenas o tempo for especificado, a data de hoje é aplicada como padrão
print(pd. Timestamp('12:00'))

"""- Criar intervalos de tempo com **Pandas Timedelta**"""

# Sintaxe: pandas.Timedelta(valor, unidade=Nenhum, **kwargs)

import pandas as pd
import datetime
from datetime import datetime

my_birth = datetime(2025,4,24) # criar uma data específica com datetime
today = datetime.today() # criar a data de hoje
tommorrow = today + pd.Timedelta(days = 1) # calcule o dia mais um dia usando o timedelta

print(my_birth - tommorrow) # quanto tempo falta para o dia de meu aniversário?

today = datetime.today()
data = today + pd.Timedelta(hours = 10) # diferença de tempo também pode ser calculada aritmeticamente

print(today, '\n')
print(data) # pode ver que 10 horas são acrescentadas ao dia de hoje

"""- Representar um período com **Período**"""

# Sintaxe: pandas.Período() - cria um período baseado em uma freqüência especificada, como diária, semanal, mensal, anual, trimestral...
#          e fornece o Timestamp que indica a hora de início e de término.

import pandas as pd

special_day = pd.Period('1973-7', freq='M')
print(special_day)

# Retornar a hora de início desse ponto no tempo
print(special_day.start_time)

# Retornar o tempo final desse ponto no tempo
print(special_day.end_time)

# Você pode criar um novo objeto de período mudando a frequência
# Exemplo: +2 (deslocamento de dois meses) porque a frequência do dia_especial é de um mês
n = special_day + 2

print(special_day, '\n')
print(n)

# Pode ver que Pandas está julgando corretamente a data completa de setembro de 1973 (há 30 dias)
print(n.start_time, n.end_time)

"""**Indexação de dados das séries cronológicas e uso básico**
- Converter outros tipos de dados em dados de séries cronológicas Carimbo da hora e indexação com DatetimeIndex
- Indexação: ordena automaticamente os dados com base em data e hora
- Faça o download do data set no [diretório compartilhado](https://drive.google.com/drive/folders/1Ig78VIVxAygFeiB4UxDZA3xmuNsf5RTZ)
"""

# Sintaxe: pandas.to_datetime(arg, errors='raise', dayfirst=False, yearfirst=False, utc=None, format=None, exact=True, unit=None, infer_datetime_format=False, origin='unix', cache=True)

import pandas as pd
wti = pd.read_csv("./data//wti/DCOILWTICO.csv") # utilizamos os dados internacionais do preço do petróleo bruto fornecidos pela FED
print(wti.head())

# Pode ver que o tipo de dados da coluna de datas é objeto
print(wti.info())

wti['N_DATE'] = pd.to_datetime(wti['DATE'])
print(wti['N DATE']) # tipo de dados é alterado para tipo datetime64

print(wti.head()) # é criada uma coluna chamada N_Date

df = wti.drop(['DATE'], axis = 1)
print(df.head()) # eliminar a coluna DATA que era o tipo de dado do objeto existente

df.set_index('N_DATE', inplace = True)
print(df.head()) # designar a coluna datetime64 recentemente criada como o índice do quadro de dados

# Agora, o quadro de dados é muito fácil de indexar ou cortar em ordem cronológica porque suporta a classe de índice da série cronológica.
print(df.info()) # completa o quadro de dados indexado por DatetimeIndex

"""**Fatiamento** usando DatetimeIndex"""

# Selecione uma data específica, e você pode cortar apenas os dados que desejar muito convenientemente.
print(df['2016-11-04':'2016-11-10'])

"""**Criação de dados de séries cronológicas**
- Criar séries temporais de freqüência específica a partir da matriz Timestamp
"""

# Sintaxe: pandas.date_range(start=None, end=None, periods=None, freq=None, tz=None, normalize=False, name=None, closed=None, **kwargs)

# início: o início do intervalo de datas, fim: o fim do intervalo de datas, períodos: o número de carimbos de data a serem criados

# Parâmetro freq para pd.date_range() para criar uma série cronológica com a freqüência desejada. O padrão é uma unidade.
# Exemplos representativos de freq:
'''   D: frequência do dia do calendário
      B: dia útil (frequência do dia útil)
      T: frequência semanal
      M: mês e frequência
      Sra: frequência de início do mês
      P: quarter e frequência'''

# Como existem 5 períodos, isso significa criar 5 Timestamps

import pandas as pd
pd.date_range(start = '2021-01-01', end = None, periods = 5, freq = 'D', t = None) # estado onde fuso horário não está definido, conte o número de dados criados

import pandas as pd
pd.date_range(start = '2021-01-01', end = '2021-12-31', periods = 5, freq = None, tz = 'Asia/Seoul') # no caso do fuso horário ser definido para Seul

import pandas as pd
pd.date_range(start = '2021-01-01', end = None, periods = 5, freq = 'M', tz = None) # caso de utilização do parâmetro como frequência baseada no final do mês

import pandas as pd
pd.date_range(start = '2021-01-01', end = None, periods = 5, freq = 'Ms', tz = None) # caso de usar a frequência como parâmetro com base na data de início do mês

"""- Criar séries temporais de frequência específica a partir da matriz de períodos"""

# Sintaxe: pandas.period_range(start=None, end=None, periods=None, freq=None, name=None)

# Pode criar dados de séries temporais contendo múltiplos períodos e frequências com period_range() -> resultado, ele retorna PeriodIndex

import pandas as pd
p_data = pd.period_range(start = '2020-1-1', end = '2020-12-31', periods = None, freq = 'M')
                 # start: início da faixa de datas / end: fim da faixa de datas / periods: número de frequências a gerar / freq: duração do período
print(p_data)

for i in p_data:
  print("{0} {1}".format(i.start_time, i.end_time))

"""**Função estatística móvel (Cálculos de rolling window)**
- A expressão "window" refere-se a um período ou seção em que dados específicos são expressos.
- Formato no qual a janela é movida automaticamente de acordo com o intervalo especificado, as estatísticas são calculadas de acordo, e os dados da série cronológica inteira são aplicados.

![image.png](data:image/png;base64,)

- Função [DataFrame Rolling](https://pandas.pydata.org/docs/reference/api/pandas.DataFrame.rolling.html): pandas.DataFrame.rolling( )
- Função de [Rolagem em Série](https://pandas.pydata.org/docs/reference/api/pandas.Series.rolling.html?highlight=series%20rolling#pandas.Series.rolling): pandas.Series.rolling( )

- Método representativo

![image.png](data:image/png;base64,)
"""

